import React from "react";
import StarBorderIcon from "@material-ui/icons/StarBorder";
const About = () => {
  return (
    <>
      <div className="about-main">
        <img src="../images/aboutquotes.png" className="rounded" alt="..." />
        <div className="text-center">
          <h2 className="text-center">Jane Doe</h2>
          {[...Array(5)].map(<StarBorderIcon>Star</StarBorderIcon>)}
        </div>
        <p className="text-center mx-10 my-5 p-5">
          Thank you for all the amazing produce and products you deliver each
          week… you make my life so easy an bring goodness into our family
          eating. I’ve been roasting a lot of brussel sprouts and
        </p>
      </div>
    </>
  );
};

export default About;
